import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom"; // Update import
import Home from "./Components/Home";
import Navbar from "./navbar";

const Tab2 = () => <h2>Tab 2 Content</h2>;
const Tab3 = () => <h2>Tab 3 Content</h2>;
const Tab4 = () => <h2>Tab 1 Content</h2>;
const Tab5 = () => <h2>Tab 2 Content</h2>;
const Tab6 = () => <h2>Tab 3 Content</h2>;
const Tab7 = () => <h2>Tab 3 Content</h2>;
const SearchResults = () => <h2>Search Results</h2>; // Add a search results component
const App = () => {
  return (
    <Router>
      <div>
        <Navbar />
        <Routes>
          {" "}
          {/* Use Routes instead of Switch */}
          <Route path="/" element={<Home />} />
          <Route path="/tab2" element={<Tab2 />} />
          <Route path="/tab3" element={<Tab3 />} />
          <Route path="/tab4" element={<Tab4 />} />
          <Route path="/tab5" element={<Tab5 />} />
          <Route path="/tab6" element={<Tab6 />} />
          <Route path="/tab7" element={<Tab7 />} />
          <Route path="/search" element={<SearchResults />} />{" "}
          {/* Add a route for search results */}
          {/* Add more routes for additional tabs */}
        </Routes>
      </div>
    </Router>
  );
};

export default App;
